import request from '@/utils/request.js'

export function login(user){
	return request({
		url:'/user/login',
		method:'post',
		data:user
	})
}

export function register(user){
	return request({
		url:'/user/register',
		method:'post',
		data:user
	})
}

export function save(user){
	return request({
		url:'/user/save',
		method:'post',
		data:user
	})
}

